function TwoSides(){
    return(
        <div>
            
            <div className="twosides">
                <div className="row">
                    <div className="col-md-6">
                        <div className="left_side">
                            <img src="../static/images/hipo.jpg" className="img-fluid" alt="adventure-image" />
                        </div>
                    </div>
                    <div className="col-md-6">
                        <div className="right_side">
                            <h1>Wild nature</h1>
                            <h2>Safe adventure</h2>
                        </div>
                    </div>
                </div>
            </div>
            <style jsx>
                {`
                    .left_side{
                        background-image:linear-gradient(rgba(0,0,0,0.5), rgba(0,0,0,0.5)), url("../static/images/hipo.jpg");
                        background-attachment: fixed;
                        background-position: center;
                        background-size: cover;
                        color: #fff;
                        text-align:center;
                        padding-top: 250px;
                        padding-bottom: 200px;
                    }
                   .right_side{
                       padding: 100px 0px;
                   } 
                   .right_side h1{
                       text-align: center;
                   }
                
                
                `}
            </style>
            
        </div>
    )
}
export default TwoSides
